  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Togiak
  National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  compliance with environmental and cultural resource mandates and research and investigations.
  Refuge administration is outlined; information about personnel, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, forests,
  and wilderness areas. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, marine mammals, fisheries resources, and scientific collections.
  The public uses of the Refuge described in this report include outdoor classrooms,
  hunting, fishing, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, major maintenance,
  equipment replacement, and communication systems. Items of interest are provided
  at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
